    function rakamGoster() {
        // Daha önce gösterilen rakamları kontrol et
        var gosterilenRakamlar = localStorage.getItem('gosterilenRakamlar');
        if (!gosterilenRakamlar) {
            gosterilenRakamlar = [];
        } else {
            gosterilenRakamlar = JSON.parse(gosterilenRakamlar);
        }

        // Henüz hiç rakam gösterilmediyse veya tüm rakamlar gösterildiyse sıfırdan başla
        if (gosterilenRakamlar.length === rakamlar.length) {
            gosterilenRakamlar = [];
        }

        // Gösterilmemiş bir rakamı seç
        var index = Math.floor(Math.random() * rakamlar.length);
        while (gosterilenRakamlar.includes(index)) {
            index = Math.floor(Math.random() * rakamlar.length);
        }

        var secilenRakam = rakamlar[index];

        // Gösterilen rakamları güncelle
        gosterilenRakamlar.push(index);
        localStorage.setItem('gosterilenRakamlar', JSON.stringify(gosterilenRakamlar));

        // Rakamı ve tarihi göster
        var rakamGosterDiv = document.getElementById("rakamGoster");
        var tarihDiv = document.getElementById("tarih");

        rakamGosterDiv.textContent = secilenRakam;
        tarihDiv.textContent = "Verildiği Tarih: " + new Date().toLocaleString();
    }

    // Sayfa yüklendiğinde bir kere çağır
    rakamGoster();

    // Belirli aralıklarla rakam göster
    setInterval(rakamGoster, 60000);  // Her dakika bir çağır
</script>
